  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tamarac NWR outlines
  Refuge accomplishments from January through April of 1948. The report begins by
  summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, mammals, raptors, and fish- is also covered. The Refuge development and
  maintenance section discusses physical developments and plantings. Resource management
  is outlined; topics include fur harvesting and timber removal. The public relations
  section of the report describes recreational uses, Refuge visitors, and violations.
  N-R forms and a fiscal year summary are attached.\",\n\t\"license_title\": \"License
